(function() {
  //imports
  var box = require('./Box');
  var soundify = require('./soundify');
  
  //data
  var imageData = 'data:image/png;base64,';
  
  var soundData = {
    SLASH1: {
      MP3: 'data:audio/mpeg;base64,',
      OGG: 'data:audio/ogg;base64,'
    },
    SLASH2: {
      MP3: 'data:audio/mpeg;base64,',
      OGG: 'data:audio/ogg;base64,'
    },
    SLASH3: {
      MP3: 'data:audio/mpeg;base64,',
      OGG: 'data:audio/ogg;base64,'
    },
    SLASH4: {
      MP3: 'data:audio/mpeg;base64,',
      OGG: 'data:audio/ogg;base64,'
    },
    CHARGE: {
      MP3: 'data:audio/mpeg;base64,',
      OGG: 'data:audio/ogg;base64,'
    },
    SPIN: {
      MP3: 'data:audio/mpeg;base64,',
      OGG: 'data:audio/ogg;base64,'
    },
  };
  var sounds = soundify(soundData);
  
  var frames = [];
  for(var row=0; row<4; row++) {
    var list = [];
    for(var col=0; col<7; col++) {
      list.push({
        x: col * 16, 
        y: row * 16, 
        cx: (0.5)*16, 
        cy: (1)*16-1, 
        width: 16, 
        height: 16, 
        hitbox: box(0,0,16,16)
      });
    }
    frames.push(list);
  }
  var temp = frames[3][0];
  frames[3][0] = frames[3][1];
  frames[3][1] = temp;
  frames.push([ //right sword attacks (4)
    { x: 0 * 16, y: 4 * 16, cx: 0.5*16, cy: 2*16-1, width: 16, height: 32, hitbox: box(1,16,15,16), attackbox: box(10,1,6,15)},
    { x: 1 * 16, y: 4 * 16, cx: 0.5*16, cy: 2*16-1, width: 32, height: 32, hitbox: box(1,17,15,15), attackbox: box(13,4,15,15)},
    { x: 3 * 16, y: 5 * 16, cx: 0.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(2,1,15,15), attackbox: box(17,9,15,6)},
  ]);
  frames.push([ //left sword attacks (5)
    { x: 4 * 16, y: 6 * 16, cx: 0.5*16, cy: 2*16-1, width: 16, height: 32, hitbox: box(0,16,15,16), attackbox: box(0,1,6,15)},
    { x: 2 * 16, y: 6 * 16, cx: 1.5*16, cy: 2*16-1, width: 32, height: 32, hitbox: box(16,17,15,15), attackbox: box(4,4,15,15)},
    { x: 0 * 16, y: 7 * 16, cx: 1.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(16,1,14,15), attackbox: box(0,9,15,6)},
  ]);
  frames.push([ //down sword attacks (6)
    { x: 0 * 16, y: 9 * 16, cx: 1.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(15,1,15,15), attackbox: box(0,9,15,6)},
    { x: 2 * 16, y: 8 * 16, cx: 1.5*16, cy: 1*16-1, width: 32, height: 32, hitbox: box(16,0,14,16), attackbox: box(4,13,15,15)},
    { x: 4 * 16, y: 8 * 16, cx: 0.5*16, cy: 1*16-1, width: 16, height: 32, hitbox: box(1,0,14,16), attackbox: box(10,16,6,15)},
  ]);
  frames.push([ //up sword attacks (7)
    { x: 3 * 16, y: 11 * 16, cx: 0.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(2,1,14,15), attackbox: box(16,1,15,6)},
    { x: 1 * 16, y: 10 * 16, cx: 0.5*16, cy: 2*16-1, width: 32, height: 32, hitbox: box(3,16,13,16), attackbox: box(14,4,15,15)},
    { x: 0 * 16, y: 10 * 16, cx: 0.5*16, cy: 2*16-1, width: 16, height: 32, hitbox: box(2,16,13,16), attackbox: box(1,1,6,15)},
  ]);
  frames.push([ //left blinking sword (8)
    { x: 5 * 16, y:  7 * 16, cx: 1.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(17,0,14,16), attackbox: box(5,9,15,6)},
    { x: 7 * 16, y:  7 * 16, cx: 1.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(17,0,14,16), attackbox: box(5,9,15,6)}
  ]);
  frames.push([ //right blinking sword (9)
    { x: 5 * 16, y:  5 * 16, cx: 0.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(1,0,14,16), attackbox: box(12,9,15,6)},
    { x: 7 * 16, y:  5 * 16, cx: 0.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(1,0,14,16), attackbox: box(12,9,15,6)}
  ]);
  frames.push([ //up blinking sword (10)
    { x: 5 * 16, y: 10 * 16, cx: 0.5*16, cy: 2*16-1, width: 16, height: 32, hitbox: box(2,16,12,16), attackbox: box(1,5,6,15)},
    { x: 6 * 16, y: 10 * 16, cx: 0.5*16, cy: 2*16-1, width: 16, height: 32, hitbox: box(2,16,12,16), attackbox: box(1,5,6,15)}
  ]);
  frames.push([ //down blinking sword (11)
    { x: 5 * 16, y:  8 * 16, cx: 0.5*16, cy: 1*16-1, width: 16, height: 32, hitbox: box(2,0,13,16), attackbox: box(9,14,6,15)},
    { x: 6 * 16, y:  8 * 16, cx: 0.5*16, cy: 1*16-1, width: 16, height: 32, hitbox: box(2,0,13,16), attackbox: box(9,14,6,15)}
  ]);
  frames.push([ //spin attack counter clock wise (12)
    { x: 0 * 16, y:  13 * 16, cx: 1.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(16, 1, 15, 15), attackbox: box(1,9, 15, 6)},
    { x: 2 * 16, y:  12 * 16, cx: 1.5*16, cy: 1*16-1, width: 32, height: 32, hitbox: box(17, 0, 15, 16), attackbox: box(12,15, 15, 15)},
    { x: 4 * 16, y:  12 * 16, cx: 0.5*16, cy: 1*16-1, width: 16, height: 32, hitbox: box(1, 0, 14, 16), attackbox: box(9,16, 6, 15)},
    { x: 5 * 16, y:  12 * 16, cx: 0.5*16, cy: 1*16-1, width: 32, height: 32, hitbox: box(1, 1, 15, 15), attackbox: box(15,13,15, 15)},
    { x: 7 * 16, y:  13 * 16, cx: 0.5*16, cy: 1*16-1, width: 32, height: 16, hitbox: box(2, 1, 15, 15), attackbox: box(17,9,15, 6)},
    { x: 0 * 16, y:  14 * 16, cx: 0.5*16, cy: 2*16-1, width: 32, height: 32, hitbox: box(1, 17, 15, 15), attackbox: box(13,4,15,15)},
    { x: 2 * 16, y:  14 * 16, cx: 0.5*16, cy: 2*16-1, width: 16, height: 32, hitbox: box(2, 16, 13, 16), attackbox: box(1,1,6,15)},
    { x: 3 * 16, y:  14 * 16, cx: 1.5*16, cy: 2*16-1, width: 32, height: 32, hitbox: box(16, 17, 15, 15), attackbox: box(4,4,15,15)},
  ]);

  function ringCopy(array, index) {
    var copy = array.concat([]);
    var first = copy.splice(index);
    return first.concat(copy);
  }

  var animations = {
    LEFT: {
      STAND: { frames: [frames[0][0]] },
      WALK: { frames: [frames[0][0], frames[0][1]] },
      PUSH: { frames: [frames[0][2], frames[0][3]] },
      PULL: { frames: [frames[0][6]] },
      CARRY: { frames: [frames[0][4], frames[0][5]] },
      ATTACK: { frames: frames[5] },
      HOLD: { frames: [frames[8][0]] },
      BLINK: { frames: [frames[8][0], frames[8][1]] },
      SPIN: { frames: ringCopy(frames[12], 1) },
    },
    RIGHT: {
      STAND: { frames: [frames[3][0]] },
      WALK: { frames: [frames[3][0], frames[3][1]] },
      PUSH: { frames: [frames[3][2], frames[3][3]] },
      PULL: { frames: [frames[3][6]] },
      CARRY: { frames: [frames[3][4], frames[3][5]] },
      ATTACK: { frames: frames[4] },
      HOLD: { frames: [frames[9][0]] },
      BLINK: { frames: [frames[9][0], frames[9][1]] },
      SPIN: { frames: ringCopy(frames[12], 5) },
    },
    UP: {
      STAND: { frames: [frames[2][0]] },
      WALK: { frames: [frames[2][0], frames[2][1]] },
      PUSH: { frames: [frames[2][2], frames[2][3]] },
      PULL: { frames: [frames[2][6]] },
      CARRY: { frames: [frames[2][4], frames[2][5]] },
      ATTACK: { frames: frames[7] },
      HOLD: { frames: [frames[10][0]] },
      BLINK: { frames: [frames[10][0], frames[10][1]] },
      SPIN: { frames: ringCopy(frames[12], 7) },
    },
    DOWN: {
      STAND: { frames: [frames[1][0]] },
      WALK: { frames: [frames[1][0], frames[1][1]] },
      PUSH: { frames: [frames[1][2], frames[1][3]] },
      PULL: { frames: [frames[1][6]] },
      CARRY: { frames: [frames[1][4], frames[1][5]] },
      ATTACK: { frames: frames[6] },
      HOLD: { frames: [frames[11][0]] },
      BLINK: { frames: [frames[11][0], frames[11][1]] },
      SPIN: { frames: ringCopy(frames[12], 3) },
    }
  };
  
  function Link(x, y) {
    this.speed = 3;
    this.x = x;
    this.y = y;
    this.direction = 'DOWN';
    this.state = 'STAND';
    this.frameIndex = 0;
    this.velocity = [0, 0];
    this.callback = null;
    this.timeout = null;
    this.slashIndex = 0;
    
    this.image = document.createElement('img');
    this.image.src = imageData;
    this.canvas = document.createElement('canvas');
    this.canvas.width = 100;
    this.canvas.height = 100;
    this.canvas.style.position = "absolute";
    this.context = this.canvas.getContext('2d');
    document.body.appendChild(this.canvas);
    
    this.render();
  }
  Link.prototype = {
    isMoving: function() {
      return this.velocity[0] !== 0 || this.velocity[1] !== 0;
    },
    isAttacking: function() {
      return this.state === 'ATTACK' || this.state === 'HOLD' || this.state === 'BLINK' || this.state === 'SPIN';
    },
    hit: function() {
      //TODO add animation when hitting something
      if(this.state !== 'SPIN' && this.state !== 'ATTACK')
        this.stopAttack();
    },
    triggerAnimationEnded: function() {
      if(this.callback !== null)
        this.callback.apply(this);
    },
    onAnimationEnded: function(callback) {
      this.callback = callback;
    },
    getFrame: function() {
      return animations[this.direction][this.state].frames[this.frameIndex];
    },
    render: function() {
      this.canvas.style.left = Math.floor(this.x-this.canvas.width/2)+'px';
      this.canvas.style.top = Math.floor(this.y-this.canvas.height/2)+'px';
      var frame = this.getFrame();
      var offsetX = Math.floor(this.canvas.width/2)-frame.cx;
      var offsetY = Math.floor(this.canvas.height/2)-frame.cy;
      this.context.clearRect(0, 0, this.canvas.width, this.canvas.height);
      this.context.drawImage(this.image, 
        frame.x, frame.y, frame.width, frame.height, 
        offsetX, offsetY, frame.width, frame.height);
    },
    getAttackBox: function(x, y) {
      x = typeof(x) === 'number' ? x : this.x;
      y = typeof(y) === 'number' ? y : this.y;
      var frame = this.getFrame();
      var attackBox = frame.attackbox;
      if(!attackBox)
        return null;
      return box(x-frame.cx+attackBox.x, y-frame.cy+attackBox.y, attackBox.width, attackBox.height);
    },
    getHitBox: function(x, y) {
      x = typeof(x) === 'number' ? x : this.x;
      y = typeof(y) === 'number' ? y : this.y;
      var frame = this.getFrame();
      var hitBox = frame.hitbox;
      return box(x-frame.cx+hitBox.x, y-frame.cy+hitBox.y, hitBox.width, hitBox.height);
    },
    tick: function(collisionNet) {
      var animationLength = animations[this.direction][this.state].frames.length;
      if(animationLength > 1 && this.frameIndex+1 == animationLength)
        this.triggerAnimationEnded();
      else
        this.frameIndex = (this.frameIndex+1) % animationLength;
      var length = Math.sqrt(Math.pow(this.velocity[0], 2)+Math.pow(this.velocity[1], 2));
      if(length > 0 && this.state !== 'SPIN') {
        var x = this.x + this.velocity[0] / length * this.speed;
        var y = this.y + this.velocity[1] / length * this.speed;
        var hitBox = this.getHitBox(x, y);
        var collisions = collisionNet.getObjects(hitBox);
        if(collisions.length === 0) {
          this.x = x;
          this.y = y;
        } else {
          if(!this.isAttacking()) {
            this.setState('PUSH');
            this.onAnimationEnded(function() {
              this.frameIndex = 0;
            });
          }
        }
      }
      this.render();
    },
    setState: function(state) {
      if(this.state !== state)
        this.frameIndex = 0;
      this.state = state;
      this.callback = null;
      if(this.timeout !== null) {
        clearTimeout(this.timeout);
        this.timeout = null;
      }
    },
    setVelocity: function(x, y) {
      if(typeof(x) === 'number')
        this.velocity[0] = x;
      if(typeof(y) === 'number')
        this.velocity[1] = y;
      if(!this.isAttacking()) {
        if(this.velocity[0] < 0) this.direction = 'LEFT';
        if(this.velocity[0] > 0) this.direction = 'RIGHT';
        if(this.velocity[1] < 0) this.direction = 'UP';
        if(this.velocity[1] > 0) this.direction = 'DOWN';
      }
    },
    startWalk: function() {
      if(!this.isAttacking()) {
        this.setState('WALK');
        this.onAnimationEnded(function() {
          this.frameIndex = 0;
        });
      }
    },
    stopWalk: function() {
      if(!this.isAttacking() && !this.isMoving())
        this.setState('STAND');
    },
    LEFTDown: function() {
      this.setVelocity(-1, null);
      this.startWalk();
    },
    LEFTUp: function() {
      this.setVelocity(0, null);
      this.stopWalk();
    },
    RIGHTDown: function() {
      this.setVelocity(+1, null);
      this.startWalk();
    },
    RIGHTUp: function() {
      this.setVelocity(0, null);
      this.stopWalk();
    },
    UPDown: function() {
      this.setVelocity(null, -1);
      this.startWalk();
    },
    UPUp: function() {
      this.setVelocity(null, 0);
      this.stopWalk();
    },
    DOWNDown: function() {
      this.setVelocity(null, +1);
      this.startWalk();
    },
    DOWNUp: function() {
      this.setVelocity(null, 0);
      this.stopWalk();
    },
    ATTACKDown: function() {
      var self = this;
      self.setState('ATTACK');
      sounds['SLASH'+(this.slashIndex+1)].play();
      this.slashIndex = (this.slashIndex + 1) % 4;
      self.onAnimationEnded(function() {
        self.setState('HOLD');
        self.timeout = setTimeout(function() {
          self.setState('BLINK');
          sounds.CHARGE.play();
          self.onAnimationEnded(function() {
            self.frameIndex = 0;
          });
        }, 500);
      });
    },
    ATTACKUp: function() {
      if(this.state === 'HOLD')
        this.stopAttack();
      else
        this.onAnimationEnded(function() {
          if(this.state === 'BLINK') {
            this.setState('SPIN');
            sounds.SPIN.play();
            this.onAnimationEnded(function() {
              this.stopAttack();
            });
          } else {
            this.stopAttack();
          }
        });
    },
    stopAttack: function() {
      if(!this.isMoving())
        this.setState('STAND');
      else
        this.setState('WALK');
      this.setVelocity();
      this.onAnimationEnded(function() {
        this.frameIndex = 0;
      });
    },
  };
  
  module.exports = Link;
})();